import { Text, View, StyleSheet } from '@react-pdf/renderer';
import List,{Item} from './List'
const styles = StyleSheet.create({
  container: {
    marginBottom: 10,
  },
  skill: {
      fontSize:10,
      flexDirection: 'row',

  },
  title: {
    fontSize: 16,
    marginBottom: 4,
    textTransform: 'uppercase',
    color:"#536DFE",

  },
  
}); 

export default ({skills=['one','two','three']}) => (
  <View style={styles.container}>
    
  </View>
);
